$GLOBALS["lang"]['<p><strong>Baseline</strong> - The overarching document that contains the baseline definition and the individual policy tests.<br> <br> <strong>Policies</strong> - The individual tests contained within a Baseline. Each test is for a specific item. An example would be testing for SSH version 1.2.3.<br> <br> <strong>Details</strong> - Baselines can compare netstat ports, users and software.<br> <br> <strong>Software</strong> - To compare software we check the name and version. Because version numbers are not all standardised in format, when we receive an audit result we create a new attribute called software_padded which we store in the database along with the rest of the software details for each package. For this reason, baselines using software policies will not work when run against a device that has not been audited by 1.10 (at least). Software policies can test against the version being "equal to", "greater than" or "equal to or greater than".<br> <br> <strong>Netstat Ports</strong> - Netstat Ports use a combination of port number, protocol and program. If all are present the policy passes.<br> <br> <strong>Users</strong> - Users work similar to Netstat Ports. If a user exists with a matching name, status and password details (changeable, expires, required) then the policy passes.<br> <br> </p>'] = '<p><strong>バズリニオ ノム・デ・ラ・ィル(ファカルターティフ、サンズ・ドート・パス・ベソイン・デーン・トラダクション)</strong> 라 superkaddokumento kiu enhavas la bazliniodifinon kaj la indifuajn strategitestojn.<br/> <br/> <strong>프로모션</strong> 라 ininfutuaj commercij enhavitaj ene de Bazlinio. Mina sintoiu testo estas por specifa objectto. Ekzemplo estus testata pri SSH-versio 1.2.3.<br/> <br/> <strong>デタロジ 소개</strong> Bazlinioj povas kompari 통계 hasnojn, uzantojn kaj softvaron.<br/> <br/> <strong>오프화이트</strong> Por kompari softvaron ni controlas 라 nomon kaj versioon. Identificar versio nombroj neestas Tial, bazlinioj uzantaj softvarpolitikojn ne funkcias dum kuro kontra epäilty aparato kiu ne estis reviziita 당 1.10 (almena kaptlus). Softvarpolitikoj povas testi kontrauna la versio estanta "egalaj al", "pli gra ol"kaptus al egala al difetto pli granda ol ".<br/> <br/> <strong>プエルト・ットスタット</strong> Netstat ポート uzas kombina 세 <br/> <br/> <strong>L\'Unione는 ーロペエンヌ를 시작합니다</strong> Uzantoj  sim simpiaj al Netstat プエルト. Se uzanto eksistas kun egala nomo, stato kaj pasvorton detaloj (publikaan Progresssiveblaj, eksvalidias, postulis) tiam la politiko pasas.<br/> <br/> </p>';

