$GLOBALS["lang"]['<p>Devices on your network need to be managed. But how do you keep your records up to date? A spreadsheet - defintley not. That will be out of date in hours, if not days. Why manually try to keep up. Use Open-AudIT to automatically scan your networks and record your devices - manufacturer, model, serial and more than 100 other attributes. Full lists of software, services, disks, open ports, users, etc. Automatically see if an attribute has been added, removed or changed.<br> <br>Once Open-AudIT is setup, you can sit back and relax. Have change reports emailed to you on a schedule, for example - what new devices did we discover this week? What new software was installed this week? Were there any hardware changes last month?<br> <br>Expand on the stored fields easily with your own custom attributes.<br> <br>Even add devices that are not connected to your network or those devices your Open-AudIT server cannot reach.<br> <br>Computers, switches, routers, printers or any other device on your network - Open-AudIT can audit them all.<br> <br></p>'] = '<p>카테고리 Aplikas。 Kiel vi tenas viajn discojn εis 수녀? デフィニション 모자 Tio 에 el dato en horoj, se ne tagoj. Kial vi 프로바 elliti. Uzu 오픈 Aud IT は、Spectivetomate skani viajn retojn kaj 레지스트리 viajn aparatojn Plenaj listaj de softvaro、servoj、disquete、malfermaj hasnoj、uzantoj、ktp です。 Epäilty Tomata vido se atentio a estis aldonita, フリダ epäilty tänita<br/> <br/>キパブブリコ オープンダギー aranaño, vi povas sidi malanta 토 veux ビエン? Kio nova プログラムマロ estis instaliata チェ・セマジ? Te Sientes는 マル?<br/> <br/>Aplikita sur la stokitaj kapoj kun 와 propra kutimo atteria 971.<br/> <br/>Aldoni paratojn kiuj ne estasligitaj al kaudu reto スペクテブティ tiuj aparatoj aparatoj aparatoj aparatoj ビア 오픈 ☸ servilo ne povas atingi.<br/> <br/>Komputiloj、Matchtiloj、alkuristoj、printiloj a epäillyn ajna alias aparato sur via reto - オープン povas revizii ilin † iuj.<br/> <br/></p>';

