$GLOBALS["lang"]['<p>The Collectors feature enables you to easily manage many "collector" computers that perform network discovery. All Collectors are centrally controlled from the Server. The only required network ports between the Collector and the Server are 80 and/or 443.<br> <br>It makes managing disparate networks quick, easy and simple. Open-AudIT Enterprise licensees get a single collector license included and have the option to buy more as required..<br> <br></p>'] = '<p>La kolektantoj igas vin と administri fortunajn "kolktilon" kiuj elfaras sendostacian eltrova. imitaiuj kommunktantoj estas centro kontrolitaj de la Servilo. 라 nuraj postulataj rethavenoj インター ラ kolektanto kaj la Servilo estas 80 kaj / a. 443.<br/> <br/>お問い合わせ 炉端串 ouvert ecoicoj risovas ununuran kolektantlicencon Inkludis kaj havas la opcion por arcaeti pli kie postulat.<br/> <br/></p>';

$GLOBALS["lang"]['<p>The SELECT section of your SQL <em>must</em> contain fully qualified columns. IE - <code>SELECT devices.id AS `devices.id`, devices.name AS `devices.name` ...</code>.<br> <br>The WHERE section of your SQL <em>must</em> contain <code>WHERE @filter</code> so Open-AudIT knows to restrict your query to the appropriate Orgs. SQL not containing this condition will result in the query failing to be created, unless you have the Admin role.<br> <br>An example query SQL showing attributes on devices that have an <code>os_group</code> attribute of "Linux" - <br><code>SELECT devices.id AS `devices.id`, devices.icon AS `devices.icon`, devices.type AS `devices.type`, devices.name AS `devices.name`, devices.os_name AS `devices.os_name` FROM devices WHERE @filter AND devices.os_group = "Linux"</code><br> <br></p>'] = '<p>La SELECT sekcio de via SQL _ ラ・セックシオ・デ・バイ・SQL <em>사이트 맵</em> Enhavas terv kvalifikitajn kolonojn입니다. IE - 한국어 <code>SELECT devices.id AS `devices.id`, devices.name AS `devices.name` ...</code>자주 묻는 질문<br/> <br/>SQLによるLa sekcio 드 <em>사이트 맵</em> 프로모션 <code>WHERE @filter</code> Tiel 오픈 Aud Escias limigi vian atendon al la konvenaj Orgs. SQL ne enhavanta tiun Kontrircaon rezultigos la atendon malsukcesantan esti kreita, se vi havas la Admin rolon.<br/> <br/>Ekzemplo kysely SQL 의 Montranta atregattojn sur aparatoj kiuj havas <code>os_group</code> 숙박 플랜 <br/><code>SELECT devices.id AS `devices.id`, devices.icon AS `devices.icon`, devices.type AS `devices.type`, devices.name AS `devices.name`, devices.os_name AS `devices.os_name` FROM devices WHERE @filter AND devices.os_group = "Linux"</code><br/> <br/></p>';

$GLOBALS["lang"]['<p>The SELECT section of your SQL <em>must</em> only contain <code>DISTINCT(devices.id)</code>.<br> <br>The WHERE section of your SQL <em>must</em> contain <code>WHERE @filter</code> so Open-AudIT knows to restrict your query to the appropriate Orgs. SQL not containing this condition will result in the group failing to be created.<br> <br>An example for SQL to select all devices running the Debian OS - <code>SELECT DISTINCT(devices.id) FROM devices WHERE @filter AND devices.os_family = "Debian"</code><br> <br></p>'] = '<p>La SELECT sekcio de via SQL _ ラ・セックシオ・デ・バイ・SQL <em>사이트 맵</em> 숙박 플랜 <code>DISTINCT(devices.id)</code>자주 묻는 질문<br/> <br/>SQLによるLa sekcio 드 <em>사이트 맵</em> 프로모션 <code>WHERE @filter</code> Tiel 오픈 Aud Escias limigi vian atendon al la konvenaj Orgs. SQL ne enhavanta tiun kontircaon rezultigos la grupon malsukcesantan esti kreita.<br/> <br/>Ekzemplo por SQL selekki ciiujn aparatojn kurantajn la Debian Os ... <code>SELECT DISTINCT(devices.id) FROM devices WHERE @filter AND devices.os_family = "Debian"</code><br/> <br/></p>';

