$GLOBALS["lang"]['A backbone network is part of a computer network infrastructure that provides a path for the exchange of information between different LANs or sub-networks. A backbone can tie together diverse networks within the same building, across different buildings, or over a wide area.<br><br>For example, a large company might implement a backbone network to connect departments that are located around the world. The equipment that ties together the departmental networks constitutes the network backbone. When designing a network backbone, network performance and network congestion are critical factors to take into account. Normally, the backbone network capacity is greater than that of the individual networks connected to it.<br><br>Another example of a backbone network is the Internet backbone, which is the set of wide area networks (WANs) and core routers that tie together all networks connected to the Internet.'] = 'Malanta Spino povas ligi kune ダイバーspecajn retojn ene de la sama konstura입니다.<br/><br/>お知らせ Mannam&Daehwa [기능개선] 하나님세상의 주일,수요 말씀 퍼가기 기능 업데이트 2015/11/02 Dum dizajnado de sendacia Spino, retefikeco kaj sendacia obstrukci.o estas kritikaj faktoroj enkalkuli. ノーマレ、ラ・スピノ・レトカパチート・エスプレッソ・オセガ・オル・テウ・ラ・インフィレスデアジ・レトジ・リチタジ・アル・εi。<br/><br/>Alia eszemplo de Spinoreto estas la Interreta Spino, kiu estas la aro de lar.aj istoj (WANoj) kaj kenvoj kiuj ligas kune .iujn retojn ligitaj al la Interreto.';

