$GLOBALS["lang"]['A campus area network (CAN) is made up of an interconnection of LANs within a limited geographical area. The networking equipment (switches, routers) and transmission media (optical fiber, copper plant, Cat5 cabling, etc.) are almost entirely owned by the campus tenant / owner (an enterprise, university, government, etc.).<br><br>For example, a university campus network is likely to link a variety of campus buildings to connect academic colleges or departments, the library, and student residence halls.'] = 'カンプタレト(CAN)は、エル・インターリゴ・デ・ラノジ・エ・デ・リミガ・ジオグラダソで 成されています。 ラ・インターコクタ・エキパ<br/><br/>Ekzample、universitata kampusreto verajne interligas gamon da kampuskinstrua.oj por ligi akademiajn altlernegojn, la bibliotekon,kaj collegeeajn lo.ejhalojn.';

$GLOBALS["lang"]['A closed port is accessible (it receives and responds to Nmap probe packets), but there is no application listening on it. They can be helpful in showing that a host is up on an IP address (host discovery, or ping scanning), and as part of OS detection. Because closed ports are reachable, it may be worth scanning later in case some open up. Administrators may want to consider blocking such ports with a firewall. Then they would appear in the filtered state, discussed next.'] = 'Fermita hasno estas alirebla (εi rizvas kaj reagas al Nmap sonde- paka ... Ili povas esti ademaj en montrado ke gastiganto estas supren sur IP- adreso (gasa eltrova.o, kaptlus pingskanado), kaj kiel parto de OS- detekto. Alternativarar fermotaj hasnoj estas atingeblaj, .i povas esti valoro skanado poste en kazo iu malferma supren. Administrantrannoj povas deziri pripensi bloki tiajn hasnojn kun fajromuro. Tiam ili aperus en la inspirita dropcommon, 디타 plei preksime.';

