$GLOBALS["lang"]['A dashboard is made up of three columns and two rows of what we call <i>widgets</i>. A widget is very similar to a summary, only we take the summary concept a bit further. Widgets are created in a simple fashion using a couple of drop down boxes - or you can elect to use your own SQL for complete customisability.'] = 'Da triboard konsistas el tri kolumnoj kaj du vicoj 드 kion ni nomas <i>·  D。</i>자주 묻는 질문 Ao estas tre simpa al revo, nur ni prenas la resegan iconon iomete plu. Vidinad estas kreita en simplia modo uzanta paron da guto malsupren kestoj - katlus vi povas elekti uzi vian propran SQL por kompleta kutimo.';

