$GLOBALS["lang"]['A global area network (GAN) is a network used for supporting mobile across an arbitrary number of wireless LANs, satellite coverage areas, etc. The key challenge in mobile communications is handing off user communications from one local coverage area to the next. In IEEE Project 802, this involves a succession of terrestrial wireless LANs.'] = 'Tutmonda isto (GAN) estas reto uzita por apogado de po aprettelefono trans arbitra nombro da serrataj Lanoj, satelitaj priraportadareoj, ktp. 라 esenca verao en movaj komunikadoj donas 당 uzantkomunikadojn de unu loka priraportadareo εis la venonta. 에 IEEE プロジェクト 802, tio implica porekvon de surteraj serrataj Lanoj.';

$GLOBALS["lang"]['A home area network (HAN) is a residential LAN used for communication between digital devices typically deployed in the home, usually a small number of personal computers and accessories, such as printers and mobile computing devices. An important function is the sharing of Internet access, often a broadband service through a cable TV or digital subscriber line (DSL) provider.'] = 'Hejmarereto (한) estos lo diplomateoma LAN uzita por kommunikado inter ciferecaj apoto tipintegrijitaj en la hejmo, kutime malmulto de personaj komputiloj kaj akcesora.oj, kiel ekzample printiloj kaj movaj movaj komputikaparajtoj. Grava funkcio estas la discoteca de retaliro, オーバーセ 라. benda サーボ 트 kablotv ido a Reserveca abonlinio (DSL) prenbzanto.';

$GLOBALS["lang"]['A list of custom TCP ports to scan (22 is SSH, 135 is WMI, 62078 is iPhone sync).'] = 'Listo de Kulimo TCP- hasnoj por skani (22 estas SSH, 135 estas WMI, 62078 estas iPhono-シンクロー).';

$GLOBALS["lang"]['A list of custom UDP ports to scan (161 is SNMP).'] = 'Listo de Kulimo UDP- hasnoj por skani (161 estas SNMP).';

$GLOBALS["lang"]['A local area network (LAN) is a network that connects computers and devices in a limited geographical area such as a home, school, office building, or closely positioned group of buildings. Each computer or device on the network is a node. Wired LANs are most likely based on Ethernet technology. Newer standards such as ITU-T G.hn also provide a way to create a wired LAN using existing wiring, such as coaxial cables, telephone lines, and power lines.<br><br>The defining characteristics of a LAN, in contrast to a wide area network (WAN), include higher data transfer rates, limited geographic range, and lack of reliance on leased lines to provide connectivity. Current Ethernet or other IEEE 802.3LAN technologies operate at data transfer rates up to 100 Gbit/s, standardized by IEEE in 2010. Currently, 400 Gbit/s Ethernet is being developed.'] = 'Loka isoreto (LAN) estos reto kiu ligas komputilojn kajn aparato en limigita geografia iso kiel ekzample hejmo, lernejo, oficejkonstrua. Imitaiu komputilo kaptlus aparato sur la reto  no nodo. Traadiga Lanoj estas plej ver kindjnaj surbaze de Ethernet- teknologio. Pli novaj ormoj kiel ekzample UIT-T G.hn ankai disponigas manieron krei dratigitan LAN uzantan ekzisztán drenadon, kiel eksample koaksiaj kabloj, telefonlinioj, kaj regulclinioj.<br/><br/>La difinaj karkteriza.oj de LAN, consite al lar rupturaaa isoreto (WAN), inkludas plijn altan dann transigtarifojn, limitan geographian インターバルライオン, kaj mankon de de deposco sur lizitaj linioj por disponigi ekkonteblecon. イーサナット 나나 ツイート Ce datentransigtarifoj εis 100 Gbit / s, normigita tariffe de IEEE en 2010. 수녀、400 Gbit/sのイーサットestas evoluigita。';

$GLOBALS["lang"]['A location is a physical address that can have devices associated with it. You can assign it coordinates and if there are devices assigned, the location will appear on the Map when you have an Open-AudIT Enterprise license.'] = 'Loko estas fizika adreso kiu povas havi aparatojn asocitajn kun liukoinen. Vi povas asignitaj, la loko aperos sur la Mapo kiam vi havas オープンダギー 株式会社.';

