$GLOBALS["lang"]['A user has a primary Org as well as a list of Orgs they can access. A user combines this with a list of assigned roles that define what actions they can take on items assigned to the Orgs they have access to. The combination of a users <i>orgs</i> and <i>roles</i> define what they can and cannot do within Open-AudIT.'] = 'Uzantoj 하바 プラマラン Org mimo kiel lister de Orgas kiun ili povas aliri. Uzanto Kombinastion kun lista de asignitaj roloj difinas kiujn fajn ili povas akcepti erojn asignitaj al la orgs kiujn ili havas aliro al. ラコビナ <i>オルゴグリオ</i> 한국어 <i>ღ♥ღ</i> difinas kion ili povas kaj ne povas fari ene de オープン 炉端串.';

$GLOBALS["lang"]['A user will have a list of associated organizations (orgs). Each org the user has will allow them to act upon items within that org as per their role(s).<br><br>All orgs except the default org have a parent. Think of an Org Chart. If a user has permission on an Org, they also have permission on any descendants of that Org.<br><br>Users are also allowed permission on a child org to see the items from parent orgs for certain collections. Those are: dashboards, discovery_scan_options, fields, files, groups, queries, reports, roles, rules, scripts, summaries, widgets.<br><br>Do not forget you have granular control over what users can see and do using Roles in Enterprise.'] = 'uzanto havos listan de rilataj organisoj (orgoj). og la uzanto permesos al ili agi sur eroj ene de tiu org kiel per ilia rolo (j).<br/><br/> 토토사이트 C\'e\' la carte de Pensu pri Org., イタリア Se uzanto havas permeson 대 Org, ili anka. havas permeson sur juj posteuloj 드 tiu org.<br/><br/>우잔토j アンカ Tiuj estas : armatuurlauad, ディスカバリー _ スキャン _ opzioni, kampraj, dosieroj, grupoj, requestoj, raportoj, roloj, reguloj, kézmőves, resumoj, vidinad.<br/><br/>니 forgesu ke vi havas grajnecan controlon de kion uzantoj povas vidi kaj fari uzante rolojn en エンタープライズ.';

$GLOBALS["lang"]['A user will have a list of associated organizations (orgs). Each org the user has will allow them to act upon items within that org as per their role(s).<br><br>All orgs except the default org have a parent. Think of an Org Chart. If a user has permission on an Org, they also have permission on any descendants of that Org.<br><br>We have also allow a user with permission on a child org to see the items from parent orgs for certain collections. Those are: dashboards, discovery_scan_options, fields, files, groups, queries, roles, rules, scripts, summaries, widgets.<br><br>Do not forget you have granular control over what users can see and do using'] = 'uzanto havos listan de rilataj organisoj (orgoj). og la uzanto permesos al ili agi sur eroj ene de tiu org kiel per ilia rolo (j).<br/><br/> 토토사이트 C\'e\' la carte de Pensu pri Org., イタリア Se uzanto havas permeson 대 Org, ili anka. havas permeson sur juj posteuloj 드 tiu org.<br/><br/>니 ankai permesas uzanton kun permeso sur infano org por vidi la erojn de gepatroj orgoj por certaj kolektoj. Tiuj estas : armatuurlauad, ディスカバリー _ スキャン _ opzioni, kampraj, dosieroj, grupoj, roloj, reguloj, kézm, resumoj, vidinad.<br/><br/>니 forgesu ke vi havas grajnecan controlon de pion uzantoj povas vidi kaj fari uzante';

$GLOBALS["lang"]['A virtual private network (VPN) is an overlay network in which some of the links between nodes are carried by open connections or virtual circuits in some larger network (e.g., the Internet) instead of by physical wires. The data link layer protocols of the virtual network are said to be tunneled through the larger network when this is the case. One common application is secure communications through the public Internet, but a VPN need not have explicit security features, such as authentication or content encryption. VPNs, for example, can be used to separate the traffic of different user communities over an underlying network with strong security features.<br><br>VPN may have best-effort performance, or may have a defined service level agreement (SLA) between the VPN customer and the VPN service provider. Generally, a VPN has a topology more complex than point-to-point.'] = 'Virtica privata reto (VPN) estas superlay reto en kiu kelkaj el ligi laloj inter nodoj estas portitaj per malfermaj ligoj a scepticaj cirkvitoj en iu pli granda reto (ekz., la Interreto) anstata guide de per fizikaj dratoj. 라 datenligtavolo protokolas de la virtual retoa la guiddire estas Sellita tra la pli gra reto kiam tio estas la kazo. Unu ofta apliki suyas estas sekura kommunikado tra la publika interreto, sed VPN ne bezonas eksplicitaj n sekurectrajtojn, kiel eksample konfirmo previsto. VPN、eksample、povas esti uzita por apartigi la trafikon de malsamaj uzantkomuniumoj スーパー subesta reto kun fortaj sekurectrajtoj.<br/><br/>VPN の povas havi plej bonan efikecon, epäilty povas havi difinitan serva nivelinterkonsenton (SLA) 인터 라 VPN- kliento kaj la VPN- servprovisanto. VPN havas topologion pli kompleksan ol punkto- 알- 펑크타.';

