$GLOBALS["lang"]['A wide area network (WAN) is a computer network that covers a large geographic area such as a city, country, or spans even intercontinental distances. A WAN uses a communications channel that combines many types of media such as telephone lines, cables, and air waves. A WAN often makes use of transmission facilities provided by common carriers, such as telephone companies. WAN technologies generally function at the lower three layers of the OSI reference model: the physical layer, the data link layer, and the network layer.'] = 'Lar Rupturaa isoreto (WAN) estas komputila kiu kovras granaio ison kiel ekzample granurbo, ランド, epäilty enhavas e 계획 interkontinentajn districijn. WAN utiligas komunikadkanalon kiu kombinas multajn specojn de amaskomunikilaro kie ekzample telefonlinioj, kabloj, kaj aarindojn. WA ofte faras uzon de transmisiipaya.oj disponigitaj 요금 de oftaj aviad- kompanioj, kiel ekze telefontleaj companyaoj. Le Commerce de gestion de l\'eau, イタリア ';

