$GLOBALS["lang"]['Being able to determine which machines are configured in the same way is a major part of systems administration and auditing – and now reporting on that will be made simple and automated. Once you define your baseline it will automatically run against a set of devices on a predetermined schedule. The output of these executed baselines will be available for web viewing, importing into a third party system or even as a printed report.<br><br>For auditing and management purposes it can be advantageous to baseline individual devices against a fixed, known good device. Baselines enable you to combine audit data with a set of attributes you have previously defined (your baseline) to determine compliance of devices.'] = '토파스 determi kiuj ma apretinoj estas formitaj la epäillyn la samanieron estas grava parto de シスムテ amministrativiio kaj revizio. キム・대・ディフィナス・リン・バズリニオン εi a skeptidtomate kuris kontraluc aparatoj en ankeriasnevalt obellaks märatud horaro. La produktado de tiuj efekkivigitaj bazlinioj estas hasbla por interretspektado, 수입 en trian partian sistemon a spective e kiel presita raporto.<br/><br/>Por reviziado kaj administrateceloj εi pova esti pava al bazlinio infinalduaj aparato kontraconfiksa, konata bona aparato. Bazlinioj rajtigas vin kombini reviziodatenojn kun aro de atentioj kiuj vi 산';

