$GLOBALS["lang"]['If you enable the configuration item, use discovery to assign an Org and then subsequently change the OrgID of a device after discovery then you will likely have a new device created the next time the discovery runs. In this instance, you should probably just unset devices_assigned_to_org before running subsequent discoveries. This is because (in this instance) you have told Open-AudIT <i>these devices from this discovery belong to Org X<i>, but then changed the Org of the device. You have changed the stored devices information. In this case - there is no no longer a device belonging to Org X, so we create a new one.'] = 'Se vi rajtigas la konfiguracion, uzu eltrova ... Org kaj tiam poste шанннний la OrgID de aparato post eltrova.o tiam vi ver apretajne havos novan aparaton kreis la venontan fojon la eltrova.o kuris. Entiu kazo, vi devus ver diverraajne nur neselektitaj aparatoj ... prizorgado de postaj eltrova ... Tio estas clar ( tiu kazo) vi rakontis al 公開 - ☸ <i>Tiuja paratoj 드 tiau eltrova.o apartenas 알 org X<i>Sed tiam ラグ・デ・ラ・パラト。 Aparatojn インフォア _ 한국어 En tia kazo, ekzistas jam ne aparato apartenanta al org x, tiel ke ni kreas novan.</i></i>';

$GLOBALS["lang"]['If you have Anti-Virus software running, allowing the services of Opmantek (omkd), Apache (apache2.2) and MySQL (mysql) to auto start and run is essential. These services are used by Open-AudIT. You should only need to do this once. If your Anti-Virus program keeps prompting you about Open-AudIT, please post to the forums or send an email to support with the name and version of your Anti-Virus software.'] = 'Se vi havas 안티 바이러스 - softvaron kurantan, perméante al la servoj de Opmantek (omkd), 아파치 (apache2.2) kaj MySQL (mysql) al supporttokomenco kaj kuri estas quenca. Tiujサーボj estas uzitaj tariffa 드 오픈- 炉端串。 일 y a un problème. Se 를 통해 안티 바이러스 - プログラマモobservatas vin pri 오픈- ☸, bonvolu po ocilato al la forumej a retpo divonaton al subteno kun la nomo kaj versio de via Anti- Virus- softvaro.';

$GLOBALS["lang"]['If you have working credentials, you can expect the full amount of information possible.<br><br>Obviously, the best way to use Open-AudIT is to have working credentials for the devices being discovered (be they WMI, SSH, or SNMP credentials).<br><br>We also have a page on auditing without credentials.'] = 'Se vi 실험실 akredita.ojn, vi povas atendi la pennan kvanton de informaoj ebla.<br/><br/>Evidente、 la plei bona maniero uzi 오픈- ☸ murtaa havi laborakredita.ojn por la aparatoj estantaj malkovrita (estu ili WMI、SSH、kaptlus SNMP- akredita.oj)。<br/><br/>お知らせ Mannam&Daehwa [기능개선] 하나님세상의 주일';

