$GLOBALS["lang"]['Networks respond differently depending on how they are configured. Some routers and/or firewalls can respond <i>on behalf</i> of IPs on the other side of their interfaces to the Open-AudIT Server. It is quite common to see Nmap report a probe for SNMP (UDP port 161) to respond as open|filtered for devices that do and do not exist. This is misleading as there is no device at that IP, yet it ends up with a device entry in the database. 99.9% of the time, it is not Open-AudIT, nor even Nmap, but the network causing this issue. Now that we have the options to treat open|filtered ports as either open or closed, we can eliminate a lot of this confusion. Enterprise users even have the option to change this on a per discovery basis (more than just using the Medium (Classic) item, as above).'] = 'Retoj rispostaas alimeniere riippuu de kiel ili estas formitaj. スチロジ kaj / 아 <i>いいえ。</i> IPs sur la alias Costato de iliaj interfacoj al la open- オーディション- セルビア. Estos tre vidi Nmap- raporton enketo por SNMP (UDP- ̄ブンノ 161) responi kiel malfermite por aparatoj kiuj faras kaj ne ekzitas. Tio estas migvida kiam ekzistas neniu aparato ankora -epäilty εi finito lidas supren kun aparatoeniro en la datumbazo. 99,9% de la Tempo, εi ne estas 오픈- ☸, nek e eritt Nmap, sed la reto kaalazanta tiun temon. 수녀 ke ni havas la opciojn por trakti malfermajn hasnojn kiel epäilty malfermaj epäilty fermotaj, ni povas elimini multe da tiu konfuzo. Empresa uzantoj y ordenación havas la opcion por дусnшition sur per eltrova.o batso (pli ol... 우리 uzante la medium (Klasika) objectkton, 키엘 supre).';

