$GLOBALS["lang"]['Nmap cannot determine whether the port is open because packet filtering prevents its probes from reaching the port. The filtering could be from a dedicated firewall device, router rules, or host-based firewall software. These ports frustrate attackers because they provide so little information. Sometimes they respond with ICMP error messages such as type 3 code 13 (destination unreachable: communication administratively prohibited), but filters that simply drop probes without responding are far more common. This forces Nmap to retry several times just in case the probe was dropped due to network congestion rather than filtering. This slows down the scan dramatically.'] = 'Nmap 네 povas デルミニ 라 filtrado povus esti 드 requila fajromura aparato, italiankieli, katlus mastro- bazita fajromuro softvaro. Tiuj hasnoj ダイバーチカ atakantojn Foje ili rispostaas kun ICMP 炉端串a gradiateoj kiel ekzample tipo 3 kodo 13 (destinado cleatingebla : kommunikado administrre malpermesita), sed intersuliloj kiuj semplicemente faligas enketojn sen repone ppperones perones. Tiuj fortoj Nmap por reeniri plurajn fojojn Tio Bremsas la skanadon 드문.';

$GLOBALS["lang"]['Nmap places ports in this state when it is unable to determine whether a port is open or filtered. This occurs for scan types in which open ports give no response. The lack of response could also mean that a packet filter dropped the probe or any response it elicited. So Nmap does not know for sure whether the port is open or being filtered. The UDP, IP protocol, FIN, NULL, and Xmas scans classify ports this way.'] = 'Nmap lokas hasnojn en tiu gritato kiam estas nekapabla determi Estas malferma su epäilty suodatin. Tio okazas por skanaj tipoj en kiuj malfermaj hasnoj donas neniun reazion. 라 manko de respono ankai povis signer ke pakafillrilo faligis la enketon a.jnan responson εi ellogis. Nmap ne scias por certa U la hasno estas malferma a rispettiva esti inferita. 라 UDP、IP- protokolo、FIN、NULL、kaj Xmas- skanadoj klasifikas hasnojn tiun manieron.';

