$GLOBALS["lang"]['On Windows, Open-AudIT uses WMI as it is primary method of auditing. Windows has a notorious reputation where remote WMI is concerned. It tends to either <i>just work</i> or some mystery item on the target requires changing. If you are experiencing difficulty auditing remote Windows PCs, we have created a script called test_windows_client.vbs. You can run this script <strong>locally</strong> on the machine in question, after signing on as the user that is used by Open-AudIT to perform the audit. The script makes <strong>no changes</strong> to the target devices. It checks most (not all) of the items below and generates PASS, FAIL and INFO tags for various properties. NOTE - If your target system is being audited correctly, you should not change any settings. Some of the below do not exist on Windows PCs that are able to be audited and some do exist. Only change settings if your discoveries on particular PCs are not working as intended.'] = 'Sur Fenestroj, 오픈-쓰리가스 WMI kiam εi estas primara metodo de reviziado. Fenestroj havas konatan reputazione kie malpreksima WMI estas maltrankvila입니다. 마 kaldun kaplustama (マ カルドン kaplustama) <i>Nincs マール ナー</i> 사이트 맵 Se vi spertas malcomediecon reviziantan malpreksimajn Fenestrojn, ni kreis manikripton nomitan testwindows _ 클라이언트.vbs. 오프화이트 <strong>사이트맵</strong> En la ma apretino preoccupazioneita, ポスト subskribado kiel la uzanto kiu estas utiligita Fare de open- 総務省 por elfari la revizion. 라 maniskripto フラス <strong>숙박 플랜</strong> ラ・セラパラトジ 세 através de celsistemo estas reviziita εuste, vi ne devus дерни анои jujn ajn 前rdojn. Kelkaj el la malsupre ne ekzistas sur Fenestroj kiuj povas 외 reviziitaj kaj kelkaj eksistas. Sur specialaj komputiloj ne funkcias 키엘 엘리트.';

