$GLOBALS["lang"]['Once you have done this, Open-AudIT will attempt to verify your user logon details against the configured Auth Method. If the user has valid credentials and <code>use_authorisation</code> is set, Open-AudIT will ask for the list of groups that the user belongs to. If the user is in the corresponding groups for Open-AudIT Roles and Orgs, those Roles and Orgs will be applied to that user.'] = 'キム・ファリストン、オープン・レイト・プロボ・コンフィルミ viajn uzantemblemojn detalojn kontra. 세 라 uzanto havas valajn akredita <code>use_authorisation</code> Estas meetita, オープン 애완 동물 라 listan de grupoj kiujn la uzanto apartenas al. Se la uzanto estas en la ekvialentaj grupoj por open- 炉端串 Roloj kaj Orgs, tiaj roloj kaj Orgs estos aplikitaj al tiu uzanto.';

