$GLOBALS["lang"]['Open-AudIT can be run on your server in your data center. It does not need access to the internet at all. Even the installation on Linux where we use the distribution package manager for our prerequisites can be negated by you using an in-house and security team-approved package repository.<br><br>Open-AudIT does not store any of your data in the cloud. Even licensing information can be provided without having to access the internet from the Open-AudIT server.<br><br>Sure, it is easier to allow it to access the internet to download packages (including security fixes) for your distribution, but that is up to you and your security policies. Open-AudIT does not need the internet.'] = 'Ava- Aud.i povas esti prizorgita sur linapáca servilon en via datumcentro. 네 bezonas aliron al interreto. 에비스돈 ラセカンテ<br/><br/>숙박 플랜 티오 ne enhavas jujn ajn da viaj datumoj en la nubo. Eruga licenciadinformoj povas et disponigitaj sen devi aliri la interreton de la Open- - servilo.<br/><br/>Certe、estas pli と permesi al εi aliri la Interreton por el apretuti paka.ojn (inkluzive de sekureco Fixas) por via Distributionio、sedtio estas εis vi kaj via sekureco politikoj. オープンタナラインターレトン。';

