$GLOBALS["lang"]['Open-AudIT has a granular permissions system to determine what a user within Open-AudIT can do, and the items he can do it to. Open-AudIT can be entirely self-contained, or use Active Directory or OpenLDAP for authentication and/or authorization.<br><br>It is entirely up to the administrator of Open-AudIT how they would like the Role Based Access Control to work.'] = 'Ava- Aud Tio havas grajnecan permeson sistemon determini kion uzanto ene de open- ☸ fari, kaj la eroj li povas fari εin. オープン povas esti 合 mem- konservita, katlus uzi Aktivan Adresaron kaptlus OpenLDAP por konfirmo kaj / a.<br/><br/>';

$GLOBALS["lang"]['Open-AudIT has a powerful change detection engine. Any device attributes that are added, removed or changed will be detected and stored. These changes can be reported upon and the relevant data confirmed as to what was expected from your company change and release process.<br><br>When a device is audited, attributes are divided into sections which correspond to tables in the database.<br><br>Each device (computer, router, printer, et al) has an entry in the <code>devices</code> table. Each entry in the devices table has an <code>id</code> column. This value is unique - it is an auto-incrementing id.<br><br>When the audit result is processed, each item in each section has its audit result compared to what is in the database.<br><br>For each section, if the key columns (see below table) contain the identical values, it is considered already installed and has its <code>last_seen</code> attribute updated. No change_log entry is created.<br><br>If any of the key columns do not match, it is considered a new attribute and is inserted. A <code>change_log</code> entry is created if the device had other attributes already present in the table.<br><br>At the completion of the audit processing, any database items that have not been updated (or inserted) are considered to not be present. The <code>current</code> attribute for this item is set to <i>n</i> and a change_log entry is generated.<br><br>So, we can determine if something is currently installed - the current column is <i>y</i>.<br><br>We can determine when something was initially detected - the <i>first_seen</i>.<br><br>We can determine if something was installed after the initial audit - first seen will be different in the component and device tables.<br><br>We can determine if something is not currently installed, but previously was - current = <i>n</i>.<br><br>We can determine the last time we detected an item - last_seen.<br><br>At any given point, we can determine what was on a system - by using the audit_log table and selecting the relevant components based on first_seen and last_seen.<br><br>Each section and its matching key columns are below.<br><br>NOTE - There are some exceptions as detailed below.<br><br>*1 - For network cards, if the computer is a VMware Esx machine it also uses the net_index and connection columns.<br><br>*2 - For partitions, f the computer is an AIX machine, we use the partition name.'] = 'Ava- Aud.i havas commercan шаном un detektomotoron. 2018年6月6日 Tiuj sur kaj la medifaj datenoj konfirmitaj kiel al kio estis atendita de via iao explakanaεo kaj eldonprocezo.<br/><br/>Kiam aparato estas reviziita, atregultoj estas distitaj en sekciojn kiuj egalrilatas al tabloj en la datumbazo.<br/><br/> aparato (komputio, tiineranto, printilo, 외) havas eniron en la <code>devices</code> タクロ。 Mezcla en la tablo 드 aparatoj havas <code>id</code> クロノ。 Tiu Valoro estas unika - εi estas a skepto-inklina id.<br/><br/>Kiam 라 reviziorezulto estas prilaborita sekcio havas sian reviziorezulton komparte kun kio estas en la datumbazo.<br/><br/>ガールフレンド를 <code>last_seen</code> Actif à εisdatigita. _ 한국어 Neniu griteno estas kreita.<br/><br/>세 ette de la esencaj kolonoj ne egalas, εi estas konsiderita nova atigita a kaj estas enigita. 자주 묻는 질문 <code>change_log</code> eniro estas kreita se la aparato havis alpijn atrophojn jam nunaj en la tabelo.<br/><br/>Alternativae 라 kompletigo 드 라 reviziopretigo 라 <code>current</code> Atributo por titu objektto estas ainacita 알 <i>ღ♥ღ</i> Ranso estas generita.<br/><br/>Tiel, 뉴스 povas determini <i>숙박 플랜</i>자주 묻는 질문<br/><br/>니 povas determi kiam io estis komence detektita - ラ <i>ラ</i>자주 묻는 질문<br/><br/>니 povas デテルミニ <br/><br/>니 povas デテルミニ Roveru io ne estas nuntempe secretita, sed anta ガイド estis... <i>ღ♥ღ</i>자주 묻는 질문<br/><br/>니 povas determi lastan fojon kiam ni detektis objectkton - 지난.<br/><br/>Iu anta.fiksita punkto, 니 povas determi ki estis sur sistemo. utiligante la revizoran tablon kaj selektante la medifajn kompontojn bazitaj sur uua _ visto kaj ultimo _ vidn.<br/><br/> Imitaiu sekcio kaj ... jaj egalaj esencaj kolonoj estas malsupre.<br/><br/>Eksistas kelkaj esceptoj kiel detalaj malsupre입니다.<br/><br/>자주 묻는 질문 1 - Por sendostaciaj kartoj, se la komputio estas VMware Esx- marajeino εi ankareazas la tt _ 인덱스 kajligokolonojn.<br/><br/>2개 ';

