$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an <code>org_id</code> column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = 'Open- Aud IT- sortipoj kun enkertuitaj roloj por admin, org _ 관리자 kaj uzanto.<br/><br/>Enerale, uzanto kiu estas amministrazione de la Open- ☸ aplika.<br/><br/>Uzanto povas havi plurajn rolojn. La permeso estos sur varamirita sur la plej persisiva nivelo - IE, se uzanto havas la rolojn de uzanto kaj org _ 株式会社, ili povos krei lokojn clarar org<br/><br/>라 관리자 rolo permesas aliron al kolektoj kiel ekzample konfiguracio, datumbazo, grupoj, ldap serviloj, tagaloj, requestoj kaj roloj. Tutmondaj eroj kiuj befolyásolja 라 tutan aplikon.<br/><br/>La org _ ₢ 킹 프로모션 <code>org_id</code> クロノ。<br/><br/>ラ・ズントロロ... Enerale permesas legi nur aliron 알 ...';

$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an org_id column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = 'Open- Aud IT- sortipoj kun enkertuitaj roloj por admin, org _ 관리자 kaj uzanto.<br/><br/>Enerale, uzanto kiu estas amministrazione de la Open- ☸ aplika.<br/><br/>Uzanto povas havi plurajn rolojn. La permeso estos sur varamirita sur la plej persisiva nivelo - IE, se uzanto havas la rolojn de uzanto kaj org _ 株式会社, ili povos krei lokojn clarar org<br/><br/>라 관리자 rolo permesas aliron al kolektoj kiel ekzample konfiguracio, datumbazo, grupoj, ldap serviloj, tagaloj, requestoj kaj roloj. Tutmondaj eroj kiuj befolyásolja 라 tutan aplikon.<br/><br/>La org _ ₢ 킹 프로모션 <br/><br/>ラ・ズントロロ... Enerale permesas legi nur aliron 알 ...';

