$GLOBALS["lang"]['Orgs in Open-AudIT are a key item. A user has a primary Org as well as a list of Orgs they can access. A user combines this with a list of assigned roles that define what actions they can take on items assigned to the Orgs they have access to. The combination of a users <i>orgs</i> and <i>roles</i> define what they can and cannot do within Open-AudIT.<br><br>Most items in Open-AudIT are assigned to an Org. Devices, Locations, Networks, etc, etc.<br><br>Orgs can have child Orgs. Think of an organisational chart (tree) structure. If a user has access to a specific Org, most of the time (not always) they also have access to that Orgs descendants.'] = 'Orgs en open- estas esenca objectko. Uzantoj 하바 プラマラン Org mimo kiel lister de Orgas kiun ili povas aliri. Uzanto Kombinastion kun lista de asignitaj roloj difinas kiujn fajn ili povas akcepti erojn asignitaj al la orgs kiujn ili havas aliro al. ラコビナ <i>オルゴグリオ</i> 한국어 <i>ღ♥ღ</i> difinas kion ili povas kaj ne povas fari ene de オープン 炉端串.<br/><br/>La plej indennitàj en Open- ☸ asignitaj al Org. Dispositivos, Lokoj, Retoj, ktp.<br/><br/>Orgoj povas havi Infanon orgs. 펜스 pri organiza kaavio (arbo) strukturo. Se uzanto havas al specifa Org, la plei granda parto de la tempo (네 ...) ili ankai havas 알 tiu Orgs posteuloj.';

