$GLOBALS["lang"]['Recently we have been asked the question - do you consider Open-AudIT more secure than other similar programs? As with most things, the answer is <i>it depends</i>.<br><br>Open-AudIT can be operated in such a way as to be extremely secure. But as usual with computer-based security, the more secure you wish to make something, the more inconvenient it becomes to use. The old phrase <i>the most secure computer is one that is turned off and in the cupboard<i> comes to mind.<br><br>Below we will outline some options that can be used with Open-AudIT that will increase security. Like most items within Open-AudIT, these are options and not mandatory. How far you take security is up to you.'] = 'Licatempe niestis esigeitaj la demando -... u vi konsidras 오픈 AudIT pli sekura oleelij simpiaj プログラムmamoj? Kiel kun la pléj utilij aferoj, 라 responsabilité estas <i>사이트 맵</i>자주 묻는 질문<br/><br/>Ava- Aud Povas esti funkciigita la epäilty tia maniero kiel por esti ekstreme sekura. Sed kiel kutime kun kompution- bazita sekureco, 라 pli sekura vi deziras fari ioni, 라 pli malkonvena εi iεas uzi. ラ・マルノバ・ブラートソ <i>라 pléj sekura komputilo estas unu kiu estas malakceptita kaj en la рranko.<i> 팟캐스트<br/><br/>Malsupre 니 스키자 kelkajn opciojn kiuj povas 외 uzitaj kun 오픈 李俊億 kiu pliigos sekurecon. Kiel la pluj utilej eroj ene de オープン 李俊億 Kiom vi prenas sekurecon estas εis vi.</i></i>';

