$GLOBALS["lang"]['WARNING - When creating a baseline using software policies, at present Centos and RedHat package the kernel using the names <i>kernel</i> and <i>kernel-devel</i>. There can be multiple packages with this name and different versions concurrently installed. Debian based distributions use names like <i>linux-image-3.13.0-24-generic</i>, note the version number is included in the package name. Because RedHat based operating systems use this format and subsequently have multiple identical package names with different versions we currently exclude <i>kernel</i> and <i>kernel-devel</i> from software policies. This may be addressed in a future update.'] = 'HOIATUS - Dum kreado 드 bazlinio uzanta softvarpolitikojn, <i>한국어</i> 한국어 <i>프로모션</i>자주 묻는 질문 Povas ekzisti multoblaj paka Debiano bazigis Distributionojn utiligas nomojn kiel <i>Lin.-kuva- 3,33,0- 24 の geneerinen</i>노우 ke la versionombro estas oxyludita en la paka. Imitaar RedHat bazigis オペラウムjn uzas tiun forman kaj poste havas multoblajn identajn paka <i>한국어</i> 한국어 <i>프로모션</i> 카테고리 티오 povas esti traktita en estonta εisdatigo.';

