$GLOBALS["lang"]['We initially setup the default list of scripts with the default options. The list of script is viewable at /scripts. These default scripts cannot be deleted. You can create additional scripts for use by you as required. Your script will be based on one of the existing scripts and have custom options applied. The scripts can then be downloaded from the list page at menu: Discover -> Audit Scripts -> List Audit Scripts.'] = 'Autres La lista de kézmprovves estas rigardebla Tiuj deha.ltaj kézmelleves ne povas esti 주변자리. 비 povas krei kromajn manikriptojn por uzo de vi kiel postulat. ビア マニクリプト estos bazita sur unu el ekzistantaj manikriptoj kaj havas kutimo eblojn aplikitaj. La maniskriptoj tiam povas esti el apretutitaj de la listpa pila Valikko : Malkovru - titulado 스크립트 de オーディション - Lista de scripts de オーディション.';

