$GLOBALS["lang"]['We only send the minimum amount of data and nothing of a sensitive nature. We send our license data (name, type, etc), our application data (name, version, platform, timezone, etc), any logged errors, a count of device types and a count of the features used. <i>Any</i> environment has devices and that is the only piece of your data we send. And only the type of device and a count. Not the manufacturer, not the model. We send nothing special. No networks. No IP addresses. No OS versions. No software names. The UUID and Server fields are sha256 encoded (so we do not know the value). We send just the data we need to improve the product. We hope you see the benefit to all of us with this information. It will provide us guided direction on where to focus improvements and new features in the product.'] = '니 nur sendas la miniman kvanton de datumoj kaj nénion de senima naturo. Ni sendas niajn licenzadatenojn (nomo, tipo, ktp), niaj apliki <i>일 n\'è un pas デ</i> Medio havas aparatojn kaj tio estas la nura peco de viaj datenoj kiujn ni sendas. Kaj nur la speco 드 aparato kaj kalkulo. 네 라 produktanto, ne la modelo. Neniujのretoj。 Neniu IP アドレゾ。 Neniu versio de Os. La UID kaj Servilo kampraj estas sha256. 니 sendas nur la datumojn, kiujn ni bezonas plibonigi la produkton. Ni esperas, ke vidas la avanta fusion al chiuj niaj soatoj. ';

