$GLOBALS["lang"]['What about other network devices? Think switches, routers, printers, etc. Obviously, it is best if you can provide some SNMP credentials for these devices. They only need <i>read-only</i> access. But if you do not want to do even that, there is nothing stopping you from running discovery, finding the devices, and making a rule or two to identify them (maybe use MAC Address prefix in combination with open ports, for example). You wont have much information, but you will know they are on the network, what they are, and when the last time they were seen was. You will also see if anything new appears on the network.'] = 'Kio prieliaj retaparatoj? C\'è una direttiva che riguarda la protezione dei lavoratori 졸업.  I <i>ღ♥ღ</i> アリロン。 セド・セン・ボラス・ファリ・エ・アジェダンダ・ケ、エキジスタ・ニオ・デ・プラゾラド・デ・エルトロド、 Trovante la aparatojn, kaj farante regulon a reguld du identgi ilin (eble uzi MAC Adresse prefikson en Kombinao kun malfermaj hasnoj, ekzample). Vi havas multe da informatooj, sed vi cios ke ili estas sur la reto, kion ili estas, kaj kiam lalla tempo ili estis viditaj estis. Vi ankai vidos -Nova aperas sur la reto.';

