$GLOBALS["lang"]['When you are using Clouds to discover your Amazon AWS instances, you will need two credential items - key and secret key. Your key should already be known to you and your secret key as well. Of note is that you cannot retrieve your secret key using the AWS Console provided by Amazon. If you have misplaced it, you will need to generate a new one.'] = 'Kiam vi uzas Nubojn por malkovri viajn Amazon AwS- kazojn, vi bezonos du grandajn erojn - calosilon kaj sekretan calosilon. バイ 카를로스릴로 brunces esti konata ankareal vi kaj ビア sekreta calosilo. De noto estas ke vi ne povas preni vian sekretan calosilon uzante la AWS 콘솔 disponigitán 요금 de Amazono. 세 vi mimetis εin, vi bezonos generi novan.';

