$GLOBALS["lang"]['When you enable a Query to be run on a schedule, the query is emailed to your chosen address. You must have set up email via menu -> Admin -> Enterprise -> Email Config. We also have a <i>test email<i> button on that page. Input your details, save it and then test it. You should have a modal box that informs you if it successful or not and obviously a test email should arrive if it is successful. Once you have email configured, your scheduled query can be configured.<br><br>Provide a name, optional description, choose <i>Query</i> type, select the desired query, provide an email address, choose a format and set the schedule.<br><br>Provide an hour (hour only, no minutes as yet), give the task a name (this is not the name of the actual scheduled query itself), select which days you would like the query run, choose which query you would like run, supply an email address and choose a query format and you are done.<br>Queries will be sent with an email body of the query (in html format) and the query attached in the requested format.'] = 'キム・エブリナス い合わせ esti prizorgita en horaro, la atendo estas retpo aprettigita al 를 통해 elektita adreso. L\'impresa - Retpo divonato Konfig. (L\'impresa - Retpo divonato Konfig.) _ 公式サイト 안카니 hava ankalükeemia(アナカニ) <i>추천 코스<i> バトノ・シル・ィテ・パジェオ。 Mémoru viajn detalojn, savi εin kaj poste 선물 n liukoinen. Vi devus havi modalan skatolon kiu informa vin se liquicipei sukcesa a skept ne kaj extenente testpoto devus alveni se εi estas sukcesa. キム・ウィ・ヴス・レトポ・クラロトン・フォルメリタ、プラビタ・アンド・エス・エスティ・フォルメリタ<br/><br/>Kondio, 라 septvola priskribo, elektas <i>ღ♥ღ</i> ティポ、セルクタス la deziratan atendon、disponigas repo explatan adreson、elektas forman kaj metis la horaron。<br/><br/>デポニーホロン(ホロン、neniujjjjjjjjjkiel ankora epäilty)、ダナス・アル・ラ・タポノモン(토이노모 de la fakta planita atendo mem)、selektas kiu tegojn vi qatus la atendokuron、elekti kiu vi griatus kuri、maksaretjjjj<br/>Päringud estos senditaj kun retpo beforetadokorpo de la atendo (en formato html) kaj la atendo ligita en la petita forma.</i></i>';

$GLOBALS["lang"]['When you enter text into one of the column headings, you can simply use a normal word. For example, when you enter <code>computer</code> into the search box above the <i>Type</i> column, the search will return all devices with the type of Computer. Essentially, Open-AudIT requests data using a URL like <code>devices?devices.type=computer</code>. Now there is one significant difference when using the dataTables search, versus the standard'] = 'Kiam vi eniras tekston en unu el la kolumnotolij, vi povas semplicemente uzi 정상적인 vorton. Ekzample、kiam vi eniras(キム・ティ) <code>computer</code> ライー organizadakesto スーパー ラ <i>롯폰기</i> ラサーラマダ・ド・コンプティコ。 エッセンス、OpenAud Ni petas datumojn uzante URL キエリ <code>devices?devices.type=computer</code>자주 묻는 질문 수녀 eksistas unu indicfa diferenco dum uzado de la daten talukot-ser previstoo, kontra. ラ';

